import React from "react";
import {
  Card,
  CardContent,
  Typography,
  Grid,
  Divider,
  List,
  ListItem,
  ListItemText,
  Paper,
  Box,
} from "@mui/material";

const TicketDetails = ({ ticket }) => {
  if (!ticket) return <Typography>No ticket data available.</Typography>;

  return (
    <Card sx={{ maxWidth: 800, margin: "20px auto", padding: 3, boxShadow: 3, borderRadius: 2 }}>
      <CardContent>
        <Typography variant="h5" gutterBottom>
          Ticket ID: {ticket.id}
        </Typography>
        <Typography variant="subtitle1" color="textSecondary">
          Status: {ticket.ticketStatus} | Created: {new Date(ticket.createdAt).toLocaleString()}
        </Typography>
        <Divider sx={{ marginY: 2 }} />

        <Box sx={{ padding: 2, backgroundColor: "#f5f5f5", borderRadius: 1 }}>
          <Typography variant="h6">Assignee</Typography>
          <Typography>
            {ticket.assignee.firstName} {ticket.assignee.lastName} - {ticket.assignee.email}
          </Typography>
          <Typography variant="body2" color="textSecondary">
            {ticket.assignee.phoneNumber} | {ticket.assignee.address}
          </Typography>
        </Box>

        <Divider sx={{ marginY: 2 }} />

        <Box sx={{ padding: 2, backgroundColor: "#f5f5f5", borderRadius: 1 }}>
          <Typography variant="h6">Customer</Typography>
          <Typography>
            {ticket.customer.firstName} {ticket.customer.lastName} - {ticket.customer.email}
          </Typography>
          <Typography variant="body2" color="textSecondary">
            {ticket.customer.phoneNumber}
          </Typography>
        </Box>







      </CardContent>
    </Card>
  );
};

export default TicketDetails;
